import styled from "styled-components";

const SInput = styled.input`
  width: 272px;
  padding: 10px;
  border-radius: 18px;
  background-color: #f5f5f5;
  margin-bottom: 8px;
  &::placeholder {
    font-size: 14px;
  }
  &:focus {
    border-color: gray;
  }
`;

function Input() {
  return <SInput />;
}
export default Input;
